package com.yw.backend;


import com.yw.backend.pojo.User;
import com.yw.backend.service.impl.user.account.InfoServiceImpl;
import com.yw.backend.service.impl.utils.UserDetailsImpl;
import com.yw.backend.service.user.account.InfoService;
import org.junit.jupiter.api.Test;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.context.SpringBootTest;
import org.springframework.security.authentication.UsernamePasswordAuthenticationToken;
import org.springframework.security.core.context.SecurityContextHolder;

import java.util.Map;

import static org.junit.jupiter.api.Assertions.assertEquals;

@SpringBootTest
public class InfoServiceTest {

    @Autowired
    private InfoService infoService;

    private void setAuthenticationToken(User user) {
        UserDetailsImpl userDetails = new UserDetailsImpl(user);
        UsernamePasswordAuthenticationToken authenticationToken = new UsernamePasswordAuthenticationToken(userDetails, null, userDetails.getAuthorities());
        SecurityContextHolder.getContext().setAuthentication(authenticationToken);
    }

    @Test
    public void testGetInfo() {
        User testUser = new User(9, "abc", "1234", "Jenssen", 0, "");
        setAuthenticationToken(testUser);
        Map<String, String> result = infoService.getInfo();
        assertEquals("success", result.get("error_message"));
        assertEquals("9", result.get("user_id"));
        assertEquals("Jenssen", result.get("name"));
        assertEquals("0", result.get("permission"));
        assertEquals("abc", result.get("username"));

    }

    @Test
    public void testGetPhoto() {
        User testUser = new User(9, "abc", "1234", "Jenssen", 0, "data:image/png;base64,");
        setAuthenticationToken(testUser);
        Map<String, String> result = infoService.getPhoto();
        assertEquals("success", result.get("error_message"));
        assertEquals("data:image/png;base64,", result.get("photo"));
    }

    @Test
    public void testGetPhoto_EmptyPhoto() {
        User testUser = new User(9, "abc", "1234", "Jenssen", 0, "");
        setAuthenticationToken(testUser);
        Map<String, String> result = infoService.getPhoto();
        assertEquals("success", result.get("error_message"));
        assertEquals("", result.get("photo"));
    }

}
